import React from 'react'

let a
let b

function add(a, b) {
  return a + b
}

function sub(a, b) {
  return a - b
}

function dive(a, b) {
  return a / b
}

function mult(a, b) {
  return a * b
}

export default add
export { sub, dive, mult }
